import React from "react";
import "./Navbar.css";
import Profile from "../../img/ekd.jpeg";
import { Link } from "react-router-dom";
// let Profile = require("../img/ekd.jpeg");

export default function Navbar() {
  const user = false;
  return (
    <div className="top">
        <div className="topLeft" >
        <i className="topIcon fa-brands fa-facebook"></i>
        <i className="topIcon fa-brands fa-linkedin"></i>
        <i className="topIcon fa-brands fa-twitter"></i>
        <i className="topIcon fa-brands fa-github"></i>
        </div>

        <div className="topCenter" >
            <ul className="topList">
                <li className="topListItem"><Link to="/" className="link">Home</Link></li>
                <li className="topListItem"><Link to="about" className="link">About</Link></li>
                <li className="topListItem"><Link to="" className="link">Contact</Link></li>
                <li className="topListItem"><Link to="" className="link">Write</Link></li>
                {/* if there is a user, show Logout, if there is no user hide logout */}
                <li className="topListItem">{user && "Logout"}</li>
            </ul>
        </div>
        <div className="topRight" >
            {/* if there is a user, display image, if not show home only */}
            {
              user ? (
                <img 
            className="topImg"
            src={Profile} 
            alt="ekd profile"/>
              ):(

                <ul className="topListItem">
                  <li className=""></li>

                </ul>

              )
            }
        <i className="topSearchIcon fas fa-search"></i>
        </div>
    </div>
  )
}
